import React from 'react';

import './App.css';

function App() {
  return (
    <div className="content">
      <header className="contentHeader">
        <div className="headerLeft">
        <img src="./images/menu.svg" alt="menu" />
        </div>
        <div className="headerCenter">
        <img width="75" src="./images/logo.svg" alt="logo" />
        </div>
      </header>
    </div>
  );
}

export default App;
